import React, {Component} from'react';
import './Captchtest.css';

class Captchtest extends Component{
	render(){
		const {onInputChange, onSubmit} = this.props; 
		return(
			<div>
				<div className = 'prompt'>Enter the Text in the Image</div>
				<div className = 'pass'>
				<input className = 'blank' type="text" onChange = {onInputChange}/>
				<div>
				<button className = "submit" onClick = {onSubmit}> Submit </button>	
				</div>
				</div>	
			</div>
		)
	}
}
export default Captchtest;
